import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

export default function DisabledOptions() {
  return (
    <>
        <Box
            sx={{
                display: 'flex',
                width: '100%',
            }}
        >
            <Paper elevation={6} >
                <Autocomplete
                    id="beg-hour"
                    options={timeSlots}
                    sx={{ width: 125 }}
                    renderInput={(params) => <TextField {...params} label="Inicio" />}
                />
                <Autocomplete
                    id="end-hour"
                    options={timeSlots}
                    sx={{ width: 125 }}
                    renderInput={(params) => <TextField {...params} label="Final" />}
                />
                <Autocomplete
                    disablePortal
                    id="day-input"
                    options={weeksDays}
                    sx={{ width: 160 }}
                    renderInput={(params) => <TextField {...params} label="Día" />}
                />
            </Paper>
        </Box>

    </>
  );
}

// One time slot every hour.
const timeSlots = Array.from(new Array(24)).map(
  (_, index) =>
    `${index < 10 ? '0' : ''}${Math.floor(index)}:${'00'}`,
);

// Week's days
const weeksDays = [
  { label: 'Lunes', year: 1994 },
  { label: 'Martes', year: 1972 },
  { label: 'Miercoles', year: 1974 },
  { label: 'Jueves', year: 2008 },
  { label: 'Viernes', year: 1957 },
  { label: 'Sábado', year: 1993 },
  { label: 'Domingo', year: 1994 },
];
